- input: "TEXT\x1CC00160937\x1CX0\x1C\x1CF3XA\x1CFederal Election Commission Washington,
    DC 20463   Dear Commissioner:  The following is a response from our committee
    regarding the request for additional information (RFAI) from Ms. Rosa Lewis dated
    September 17, 2008. 1.) ?Loan Payment? listed on Schedule B supporting Line 26
    was a disbursement by the Committee for payment on a committee Non Federal account
    loan. The amended report correctly lists this disbursement on supporting Line
    29. 2.) Schedule H4 previously disclosed disbursements erroneously reported as
    allocable. These expenses have been moved to Schedule B. Allocated activity and
    event year-to-date total calculations for the Administrative category have been
    corrected. 3.) The full name and/or mailing address has been included for venders
    on Schedule B supporting Line 21(b) of the Detailed Summary page. 4.) Itemized
    disbursements listing ?Technology? as the description have been clarified. 5.)
    Reimbursements to individuals for travel and subsistence advances have been amended
    to include itemized memo entries of the original vendor(s). 6.) Schedule H4 previously
    disclosed disbursements erroneously reported as allocable. These expenses have
    been moved to Schedule B. Remaining reimbursements to individuals on Schedule
    H4 are for expenses correctly reported as allocable. Schedule H4 as amended has
    memo entries including the name and address of the original vendor. 7.) Schedule
    B supporting Line 21(b) erroneously reported an in-kind contribution of ?On-Line
    Voter File Access.? The report has been amended to correct this error and the
    in-kind contribution in question has been reported on both Schedule A supporting
    Line 12 and Schedule A supporting Line 21(b). 8) The Committee?s Debt Schedule
    has been amended, and payment on federal debt due to Tony Doom Supply was made
    with Non Federal funds on 6/25/2008. This payment is listed as a negative accrual
    on the amended report. If you have any questions or need additional information,
    feel free to contact our committee at (605) 271-5405. Sincerely, Bill Nibbelink,
    Treasurer, South Dakota Democratic Party\n"
